import styled from 'styled-components';

export const List = styled.ul`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
`;
export const Item = styled.li`
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;

  max-width: 360px;
`;
